import Slider from "./subcomponents/slider.js"
import Productos from "./subcomponents/nuestros_productos.js"
import "../assets/style/principal.scss"

const Front = () => {
return(
    <div className="container">
        <Slider/>
        <Productos/>
    </div>
)}


export default Front
